properties.description:
Attico e superattico in signorile condominio in vendita in zona piazzale Loreto, una delle zone più vibranti di Milano, appartamento di 230 mq più 205 mq di terrazza e balconi, con una vista a 360° su Milano. 
zona giorno composta da triplo salone, cucina abitabile con affaccio su terrazzino, studio/camera degli ospiti/camera di servizio dotato di balcone, bagno;
zona notte composta da tre camere da letto tutte dotate di balcone, di cui una con bagno en-suites, disimpegno, terzo bagno e zona lavanderia;
una comoda scala porta al nono piano dove si trova una veranda dotata di piccola cucina e un unico terrazzo splendidamente piantumato da cui si gode una straordinaria vista su tutta la città di Milano, dallo Skyline di Porta Garibaldi alle Alpi, che si estende per tutta la superficie dell'a
